import React from 'react';

import Sidebar from '../Sidebar/Sidebar';
import styles from './Dashboard.css';

function Dashboard() {
    return (
        <div className={styles.Dashboard}>
            <Sidebar />
        </div>
    )
}

export default Dashboard;
